    12 (Transfers).  The purpose codes on Line 21(b) for printing, telecommunications,
    telephone/communications, and telephone calls have been amended to give more concise
    descriptions.  Please be aware that these payments did not meet the definition
    for Federal Election Activity and were therefore reported on Schedule 21(b).  The
    payments reported on Line 30(b) have been given more concise descriptions.  Please
    note that these expenses did not contain express advocacy.  The payments listed
    on Schedule B for Consulting/Day Workers were for Canvassers. The purpose code
    listed as Operating has been corrected.  The payments listed on Schedule H4 for
    Consulting/Day Workers were for general admin work.  These consultants did not
    spend more than 25% of their time on Federal Election Activity nor in connection
    with a federal election. The payroll listed on Schedule H4 reflects the remainder
    of staff who did not spend more than 25% of their time on Federal Election Activity
    nor in connection with a federal election and were properly reported on H4.  The
    catering payment listed on Schedule H4 was for the Committee?s event at the Democratic
    National Convention.  The purpose codes on Schedule H4 for printing, telecommunications,
    telephone/communications, and telephone calls have been amended to give more concise
    descriptions.  These ADMIN expenses were not made in connection with a federal
    election nor made on behalf of a federal candidate.  The year to date total for
